import React, { Component } from 'react'

export default class DateFunction extends Component {
    constructor() {
        super();

        var today = new Date(),
        date = today.toLocaleString('en-us', {day:'2-digit', month: 'long'});

        this.state = {
            date: date
        };
    }

    render() {
        return (
            <div className='date'>
                <h2>{this.state.date}</h2>
            </div>
        );
    }
}
